  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'Sheetz';
  products: ProductModel []=[];
  constructor(){
    for(var item of mock_list){
      console.log(item);
      this.products.push(item);
    }
  }
}

